        attribute massPositive : Boolean = mass > 0;
        attribute forceRelationOk : Boolean = force == mass * deltaVelocity / time;
    }

    part def VehicleSystemModel {
        part vehicle : Vehicle;
        part dynamics : DynamicsModel;
    }
